wealth_source_other_upload_tips:
โปรดระบุเอกสารที่มีประสิทธิภาพที่สามารถพิสูจน์กิจกรรมการซื้อขายของคุณ โปรดทราบ:
·สามารถครอบคลุมข้อมูลที่ละเอียดอ่อนบางอย่าง แต่ไฟล์ทั้งหมดจะต้องแสดงอย่างชัดเจน: ชื่อ, วันที่, ลายเซ็นและแสตมป์;
มุมทั้งสี่ของไฟล์จะต้องมองเห็นได้ชัดเจน
·รายละเอียดการทำธุรกรรมจะต้องแสดงอย่างชัดเจน: จำนวนธุรกรรม, รายละเอียดของผู้ชำระเงิน/บุคคลแรกรายละเอียดการชำระเงิน ฯลฯ ;

wealth_source_salary_upload_tips:
โปรดเลือกบทบัญญัติและอัปโหลดจากไฟล์ต่อไปนี้:
·แสดงใบเรียกเก็บเงินที่จ่ายสำหรับรายได้ของคุณในช่วง 3 เดือนที่ผ่านมา
·ตั๋วเงินธนาคารที่แสดง 3 เดือนสุดท้ายของเงินเดือน;
·รายงานภาษีประจำปีภาษีก่อนหน้า;

wealth_source_pension_upload_tips:
โปรดเลือกบทบัญญัติและอัปโหลดจากหลักฐานไฟล์ต่อไปนี้:
·รายงานเงินปันผล;
·โปรโตคอลการกระจาย;
·แสดงการชำระเงินของการชำระเงินของธนาคาร
·บัญชี บริษัท ล่าสุดของการตรวจสอบ;

